import React from 'react'
import './buttons.css'
type AddButtonProps = {
  handleMultiplyButtonClick: () => void;
};
function MultiplyButton({handleMultiplyButtonClick}: AddButtonProps) {
  return (
    <div>
       <button
       onClick={handleMultiplyButtonClick}>*</button>
    </div>
  )
}

export default MultiplyButton
